  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Student Status Id',
  `name` varchar(255) DEFAULT NULL COMMENT 'Name',
  `short_code` varchar(50) NOT NULL COMMENT 'Short Code',
  `active_status` tinyint(1) DEFAULT NULL COMMENT 'Active Status',
  `createdby` int(11) DEFAULT NULL COMMENT 'Created Id',
  `createdat` datetime DEFAULT NULL COMMENT 'Created Datetime',
  `updatedby` int(11) DEFAULT NULL COMMENT 'Updated Id',
  `updatedat` datetime DEFAULT NULL COMMENT 'Updated Datetime',
  PRIMARY KEY (`short_code`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Student Status';


DROP TABLE IF EXISTS `student_update_info`;
CREATE TABLE `student_update_info` (
  `id` bigint(255) NOT NULL AUTO_INCREMENT COMMENT 'Student Update Info',
  `admission_no` varchar(255) DEFAULT NULL COMMENT 'Admission No',
  `first_name` varchar(255) DEFAULT NULL COMMENT 'First Name',
  `last_name` varchar(255) DEFAULT NULL COMMENT 'Last Name',
  `father_name` varchar(255) DEFAULT NULL COMMENT 'Father Name',
  `mother_name` varchar(255) DEFAULT NULL COMMENT 'Mother Name',
  `email_id` varchar(255) DEFAULT NULL COMMENT 'Email Id',
  `primary_phno` varchar(255) DEFAULT NULL COMMENT 'Phone No',
  `present_address` longtext COMMENT 'Present Address',
  `image` varchar(255) DEFAULT NULL COMMENT 'Image',
  `password` varchar(255) DEFAULT NULL COMMENT 'Password',
  `createdby` int(11) DEFAULT NULL COMMENT 'Created Id',
  `createdat` datetime DEFAULT NULL COMMENT 'Created Datetime',
  `updatedby` int(11) DEFAULT NULL COMMENT 'Updated Id',
  `updatedat` datetime DEFAULT NULL COMMENT 'Updated Datetime',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Student Update Info';


DROP TABLE IF EXISTS `transaction_logs`;
