  `cur_list_academicyear_id` varchar(255) DEFAULT NULL COMMENT 'List AcademicYear Id',
  `list_branch_id` bigint(13) DEFAULT NULL COMMENT 'Branch Id',
  `cur_branch_orientation_id` int(11) DEFAULT NULL COMMENT 'Branch Orientation Id',
  `cur_branch_class_id` int(11) DEFAULT NULL COMMENT 'Branch Class Id',
  `cur_branch_class_section_id` int(11) DEFAULT NULL COMMENT 'Branch Class Section Id',
  `student_admission_id` int(11) DEFAULT NULL COMMENT 'Student Admission Id',
  `admission_no` varchar(255) DEFAULT NULL COMMENT 'Admission No',
  `name` varchar(255) DEFAULT NULL COMMENT 'Name',
  `transactiondate` date DEFAULT NULL COMMENT 'Transaction Date',
