INSERT INTO `core_report_template` (`id`, `name`, `short_code`, `is_progressreport`, `template`, `createdby`, `createdat`, `updatedby`, `updatedat`) VALUES
(1,	'progressreport',	'PGR',	NULL,	'<div style=\"\r\n    border-bottom-color: black;\r\n    margin: 15px;\r\n    border-radius:25px;\r\n    border: 2px;\r\n    display: table;\r\n    border: 2px solid #a1a1a1;  \r\n\">\r\n<div id=\"progressreport\" style=\"width: 650px; padding-top: 10px; margin-left: 50px; margin-top: 30px; font-family: serif;\">\r\n<div class=\"heading\">\r\n<div id=\"organization_details\"><span style=\"font-family:georgia,serif\">{ORGANIZATIONLOGO} <span style=\"color:#0000FF\">{ORGANIZATIONNAME} </span> </span></div>\r\n</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div style=\"padding-top: 15px;\">\r\n<table style=\"margin-top:15px; width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Admission No</td>\r\n			<td>:</td>\r\n			<td>{ADMISSIONNO}</td>\r\n			<td>Name</td>\r\n			<td>:</td>\r\n			<td>{NAME}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Branch</td>\r\n			<td>:</td>\r\n			<td>{BRANCH}</td>\r\n			<td>Course</td>\r\n			<td>:</td>\r\n			<td>{COURSE}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Class</td>\r\n			<td>:</td>\r\n			<td>{CLASS}</td>\r\n			<td>Section</td>\r\n			<td>:</td>\r\n			<td>{SECTION}</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<div class=\"examnamediv\" style=\"text-align: center;\"><strong><span style=\"color:#ff3300\">{EXAMNAME} </span></strong></div>\r\n\r\n<div id=\"marksdetails\" style=\"text-align: center; width:600px;\">\r\n<div>\r\n<table align=\"center\" border=\"2px;\" style=\"border-collapse:collapse; margin-top:20px; text-align:center; width:600px\">\r\n	<tbody><!--<rhead>-->\r\n		<tr>\r\n			<th>Subject</th>\r\n			<th>Max Marks</th>\r\n			<!--<exnamelist>-->\r\n			<th>{ENAME}</th>\r\n			<!--</exnamelist>-->\r\n			<th>Grade</th>\r\n			<th>Grade Points</th>\r\n			<th>Remarks</th>\r\n		</tr>\r\n		<!--</rhead>--><!--<data>-->\r\n		<tr>\r\n			<td style=\"text-align:left\"><strong>{SUBJECTNAME}</strong></td>\r\n			<td>{MM}</td>\r\n			<!--<exrs>-->\r\n			<td>{OBTAINEDMARKS}</td>\r\n			<!--</exrs>-->\r\n			<td>{GRADE}</td>\r\n			<td>{GRADEPOINTS}</td>\r\n			<td>{REMARKS}</td>\r\n		</tr>\r\n		<!--</data>-->\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<div>\r\n<table align=\"center\" style=\"margin-top:20px; text-align:center; width:600px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>GRADE TOTAL</td>\r\n			<td>:</td>\r\n			<td>{GRANDTOTAL}</td>\r\n			<td>Final Grade</td>\r\n			<td>:</td>\r\n			<td>{FINALGRADE}</td>\r\n			<td>GPA</td>\r\n			<td>:</td>\r\n			<td>{GPA}</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<div style=\"display: table; padding-top: 15px;\">Overall Remarks:<strong>{OVERALLREMARKS}</strong></div>\r\n</div>\r\n\r\n<div style=\"text-align: right; margin-top: 20px; padding-right: 18px;padding-bottom: 13px;\">\r\n<div style=\"height:30px;\">&nbsp;</div>\r\n\r\n<div style=\"font-weight: bold;\">Authorised Signature</div>\r\n</div>\r\n</div>\r\n</div>\r\n',	NULL,	'2017-05-19 11:36:05',	NULL,	'2017-05-19 11:36:05');
