INSERT INTO `lib_book_deatils` (`id`, `lib_publisher_id`, `name`, `code`, `edition`, `description`, `image`, `pages`, `createdby`, `createdat`, `updatedby`, `updatedat`) VALUES
(1,	'1',	'Science Year by Year',	'1465457585',	NULL,	'Packed with fascinating discoveries and facts, Science Year by Year takes kids on a fantastic visual journey through time, from stone tools and simple machines to rockets and robots.',	'',	450,	NULL,	'2017-05-04 10:39:27',	NULL,	'2017-05-04 12:14:33'),
(2,	'1',	'History Year by Year',	'M490BJY98RDQTYVP1T7Q',	NULL,	'Featuring more than 1,500 images that bring the story of the past to life through a detailed timeline, this visual reference helps children navigate the influences, patterns, and connections between historical events, beginning with prehistory and running up to the Arab Spring.',	'',	350,	NULL,	'2017-05-04 10:40:13',	NULL,	'2017-05-04 12:22:15'),
(3,	'1',	'Where on Earth',	'QWYR1F2D21KY9DBTSE',	NULL,	'Where are the world\'s tallest buildings? Where are earthquakes most likely to occur? Where can you find animals that glow? Showcasing the most fascinating places on the planet, Where on Earth? is a collection of more than 75 3-D maps that show not only where everything is, but also why it\'s there.\r\nDivided into six chapters: Geography, Nature, People, History, Arts & Entertainment, and Science & Technology, Where on Earth? brings an instant understanding to a wealth of subjects, stimulating interest in the world around us and drawing young readers into the topic. From physical geography, habitats of big cats, the Seven Wonders of the World, Olympic cities, shipwreck sites, and more, every map contains fact panels that provide additional information and useful statistics, while focus features pull out and explain the most interesting facets for an even richer experience.',	'',	350,	NULL,	'2017-05-04 10:40:56',	NULL,	'2017-05-04 12:22:07'),
(4,	'2',	'Activity Book1',	'ACT003415641',	'1st Edition',	'1st Activity Book - English is a fun filled treasure house of assignments that entertains as well as enhances the children grasping and understanding about the basic concept of the English Language.',	'bookimage.jpg',	250,	NULL,	'2017-05-17 12:17:32',	NULL,	'2017-05-17 12:17:32');
